import './App.css';
import Header from "./components/header/Header";
import Footer from "./components/footer/Footer";
import MainPageRoutes from "./routes/MainPageRoutes";

const user = {
    roles: ['user'],
    rights: ['can_view_articles']
};

const admin = {
    roles: ['user', 'admin'],
    rights: ['can_view_articles', 'can_view_users']
};

function App() {
    return (
        <div className="App">
            <Header/>
            <main>
                <MainPageRoutes user={admin}/>
            </main>
            <Footer/>
        </div>
    );
}

export default App;
